import React, { useState, useEffect } from "react";
import api from "../../api/api";
import { normalizeResponse } from "../../utils/normalizeResponse";
import StarRating from "../../components/StarRating";

const AdminDashboard = () => {
  const [stores, setStores] = useState([]);
  const [ratings, setRatings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [selectedStore, setSelectedStore] = useState(null);
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [address, setAddress] = useState("");

  const updateStore = async () => {
    try {
      await api.put(`/stores/admin/${selectedStore.id}`, {
        name,
        email,
        address,
      });
      setSelectedStore(null);
      window.location.reload();
    } catch (error) {
      console.error("Error updating store:", error);
    }
  };
  useEffect(() => {
    const fetchData = async () => {
      try {
        const [storesRes, ratingsRes] = await Promise.all([
          api.get("/stores/admin/all"), // ✅ correct route
          api.get("/ratings/admin/all"), // ✅ correct route
        ]);
        setStores(normalizeResponse(storesRes));
        setRatings(normalizeResponse(ratingsRes));
      } catch (error) {
        console.error("Error fetching admin data:", error);
      } finally {
        setLoading(false);
      }
    };
    fetchData();
  }, []);

  const deleteStore = async (id) => {
    try {
      await api.delete(`/stores/admin/${id}`); // ✅ correct route
      setStores((prev) => prev.filter((s) => s.id !== id));
    } catch (error) {
      console.error("Error deleting store:", error);
    }
  };

  const deleteRating = async (id) => {
    try {
      await api.delete(`/ratings/${id}`); // ✅ same for admin
      setRatings((prev) => prev.filter((r) => r.id !== id));
    } catch (error) {
      console.error("Error deleting rating:", error);
    }
  };

  if (loading) return <div>Loading...</div>;

  return (
    <div className="dashboard-container">
      <h2>Admin Dashboard</h2>

      <h3>All Stores</h3>
      <div className="stores-grid">
        {stores.length > 0 ? (
          stores.map((store) => (
            <div key={store.id} className="store-card">
              <h4>{store.name}</h4>
              <p>{store.address}</p>
              <p>Email: {store.email}</p>
              <p>
                Owner: {store.owner?.name} ({store.owner?.email})
              </p>
              <button
                onClick={() => deleteStore(store.id)}
                className="btn btn-danger"
              >
                Delete
              </button>
            </div>
          ))
        ) : (
          <p>No stores found.</p>
        )}
      </div>

      <h3>All Ratings</h3>
      <div className="ratings-grid">
        {ratings.length > 0 ? (
          ratings.map((r) => (
            <div key={r.id} className="rating-card">
              <p>
                <strong>User:</strong> {r.user?.name} ({r.user?.email})
              </p>
              <p>
                <strong>Store:</strong> {r.store?.name}
              </p>
              <p>
                <strong>Rating:</strong> <StarRating rating={r.rating} />
              </p>
              <p>
                <strong>Comment:</strong> {r.comment}
              </p>
              <button
                onClick={() => deleteRating(r.id)}
                className="btn btn-danger"
              >
                Delete
              </button>
            </div>
          ))
        ) : (
          <p>No ratings found.</p>
        )}
      </div>
    </div>
  );
};

export default AdminDashboard;
